import React, { useEffect, useState } from 'react';
import { useNavigate, Link, useLocation } from 'react-router-dom';
import { Bar } from 'react-chartjs-2';
import { Chart, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend } from 'chart.js';

Chart.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

function Dashboard() {
  const [commissionData, setCommissionData] = useState(null);
  const [violationsData, setViolationsData] = useState(null);
  const [commissionHistory, setCommissionHistory] = useState([]);
  const [showDetails, setShowDetails] = useState(false);
  const [showQualifications, setShowQualifications] = useState(false);
  const navigate = useNavigate();
  const location = useLocation();

  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    if (!userEmail) {
      navigate('/');
      return;
    }

    const fetchData = async () => {
      const response = await fetch(`https://us-central1-optimal-comfort-464220-t1.cloudfunctions.net/loginHandler?email=${userEmail}`);
      const result = await response.json();
      if (result.success) {
        setCommissionData(result.commissionData);
        setViolationsData(result.violationsData);
        setCommissionHistory(result.commissionHistory || []);
      } else {
        alert("Failed to fetch data");
      }
    };

    fetchData();
  }, [navigate]);

  if (!commissionData || !violationsData) return <div>Loading...</div>;

  const agentFirstName = commissionData.agentname ? commissionData.agentname.split(" ")[0] : "Agent";
  const weekStart = commissionData.week_start_date || "N/A";
  const weekEnd = commissionData.week_end_date || "N/A";

  const chartLabels = commissionHistory.map(item =>
    (item.week_start_date && item.week_end_date)
      ? `${item.week_start_date} - ${item.week_end_date}`
      : 'N/A'
  );
  const chartValues = commissionHistory.map(item => {
    const value = item["commissionafterarfeescanningviolations"];
    return typeof value === "string" ? parseFloat(value.replace(/[$,]/g, '')) || 0 : value || 0;
  });

  const commissionChartData = {
    labels: chartLabels,
    datasets: [
      {
        label: 'Commission ($)',
        data: chartValues,
        backgroundColor: '#d32f2f',
      }
    ],
  };

  const totalYTD = commissionHistory.reduce((acc, cur) => {
    const val = cur["commissionafterarfeescanningviolations"];
    const num = typeof val === "string" ? parseFloat(val.replace(/[$,]/g, '')) || 0 : val || 0;
    return acc + num;
  }, 0).toFixed(2);

  return (
    <div style={{ display: "flex", minHeight: "100vh", fontFamily: "Arial, sans-serif" }}>
      {/* Sidebar */}
      <div style={{ backgroundColor: "#d32f2f", color: "#fff", width: "200px", padding: "20px" }}>
        <img src="/fiesta-logo.png" alt="Fiesta Logo" style={{ width: "150px", marginBottom: "20px" }} />
        <nav>
          <ul style={{ listStyle: "none", padding: 0 }}>
            <li>
              <Link
                to="/dashboard"
                style={{
                  display: "block",
                  backgroundColor: location.pathname === '/dashboard' ? "#fff" : "#d32f2f",
                  color: location.pathname === '/dashboard' ? "#d32f2f" : "#fff",
                  textDecoration: "none",
                  padding: "10px",
                  borderRadius: "5px",
                  marginBottom: "10px",
                  textAlign: "center"
                }}
              >
                Dashboard
              </Link>
            </li>
            <li>
              <Link
                to="/sv-ar"
                style={{
                  display: "block",
                  backgroundColor: location.pathname === '/sv-ar' ? "#fff" : "#d32f2f",
                  color: location.pathname === '/sv-ar' ? "#d32f2f" : "#fff",
                  textDecoration: "none",
                  padding: "10px",
                  borderRadius: "5px",
                  marginBottom: "10px",
                  textAlign: "center"
                }}
              >
                Current SV & AR
              </Link>
            </li>
          </ul>
        </nav>

        <button
          onClick={() => {
            localStorage.removeItem('userEmail');
            navigate('/');
          }}
          style={{
            display: "block",
            width: "100%",
            backgroundColor: "yellow",
            color: "#d32f2f",
            border: "none",
            padding: "10px",
            borderRadius: "5px",
            cursor: "pointer",
            marginTop: "10px",
            fontWeight: "bold",
            textAlign: "center"
          }}
        >
          Logout
        </button>
      </div>

      {/* Main content */}
      <div style={{ flex: 1, backgroundColor: "#f9f9f9", padding: "20px" }}>
        <h1>Welcome, {agentFirstName}</h1>

        {/* Weekly Commission */}
        <div style={{ backgroundColor: "#fff", border: "1px solid #ddd", borderRadius: "5px", marginBottom: "20px" }}>
          <div style={{ backgroundColor: "#d32f2f", color: "#fff", padding: "10px", fontWeight: "bold", borderRadius: "5px 5px 0 0" }}>
            Weekly Commission | {weekStart} - {weekEnd}
          </div>
          <div style={{ padding: "10px" }}>
            <p><strong>Agent Name:</strong> {commissionData.agentname}</p>
            {/* All other commission details */}
            <button onClick={() => setShowDetails(!showDetails)} style={{ backgroundColor: "#d32f2f", color: "#fff", border: "none", padding: "5px 10px", borderRadius: "3px" }}>
              {showDetails ? "Hide Other Details" : "Show Other Details"}
            </button>
            <button onClick={() => setShowQualifications(!showQualifications)} style={{ backgroundColor: "#d32f2f", color: "#fff", border: "none", padding: "5px 10px", borderRadius: "3px", marginLeft: "10px" }}>
              {showQualifications ? "Hide Qualifications" : "Commission Qualifications"}
            </button>
          </div>
        </div>

        {/* Commission History */}
        <div style={{ backgroundColor: "#fff", border: "1px solid #ddd", borderRadius: "5px" }}>
          <div style={{ backgroundColor: "#d32f2f", color: "#fff", padding: "10px", fontWeight: "bold", borderRadius: "5px 5px 0 0" }}>
            📈 Commission History
          </div>
          <div style={{ padding: "10px" }}>
            <Bar data={commissionChartData} options={{ responsive: true, plugins: { legend: { display: false }, title: { display: true, text: 'Commission History' } } }} />
            <div style={{ marginTop: "10px", fontWeight: "bold" }}>
              Total Commission YTD: ${totalYTD}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
